    <script>
        // Define the necessary document variables
        let svgMapElement = document.getElementById("svg-map");
        let svgMapGroupElement = document.getElementById("svg-group");

        // Define a function to update the scale and translation of the SVG
        const zoomInFactor = 1.2;
        const zoomOutFactor = 0.8;
        let scale = 1;
        let translate = [0, 0];
        function scale_and_translate(scale, translate) {
            let scale_and_translate_string = "scale(" + scale + ", " + scale + ") translate(" + translate[0] + ", " + translate[1] + ")"
            svgMapGroupElement.setAttributeNS(null, "transform", scale_and_translate_string)
        }

        // Mouse-based controls
        svgMapElement.onwheel = handleWheel;
        svgMapElement.onmousedown = handleDragStart;
        svgMapElement.onmouseup = handleDragEnd;
        svgMapElement.onmousemove = handleDragMove;

        function handleWheel(event) {
            let svgBoundingRect = svgMapElement.getBoundingClientRect();
            let relativeX = (event.clientX - svgBoundingRect.x) / scale;
            let relativeY = (event.clientY - svgBoundingRect.y) / scale;

            // Zoom in or out depending on scroll direction and then re-center on mouse position
            if (event.deltaY > 0) {
                if (scale * zoomOutFactor > 0.25) {
                    scale = scale * zoomOutFactor;
                    translate = [translate[0] + (1 - zoomOutFactor) * relativeX, translate[1] + (1 - zoomOutFactor) * relativeY]
                }
            } else {
                if (scale * zoomInFactor < 10) {
                    scale = scale * zoomInFactor;
                    translate = [translate[0] + (1 - zoomInFactor) * relativeX, translate[1] + (1 - zoomInFactor) * relativeY]
                }
            }

            scale_and_translate(scale, translate)
        }

        // Note that dragging has started
        let isDragging = false;
        let dragStartX = 0;
        let dragStartY = 0;
        function handleDragStart(event) {
            isDragging = true;
            dragStartX = event.clientX;
            dragStartY = event.clientY;
        }

        // Note that dragging has ended
        function handleDragEnd(event) {
            isDragging = false;
        }

        // Translate the SVG based on drag amount
        function handleDragMove(event) {
            if (isDragging) {
                translate = [translate[0] - (dragStartX - event.clientX) / scale, translate[1] - (dragStartY - event.clientY) / scale];
                scale_and_translate(scale, translate);
                dragStartX = event.clientX;
                dragStartY = event.clientY;
            }
        }
    </script>
